Step-by-step reasoning:

1. Key psychological mechanisms: Responders compare the monetary offer (split_self) to a fairness expectation (fair_share) calculated from their token contribution relative to the total tokens and multiplied by the total combined earnings. When the offer is worse than the fair share, a “penalty” is applied capturing sensitivity to inequity. In contrast to previous models that used a linear or quadratic penalty, here we assume that the penalty may have non‐linear (power law) sensitivity: small deviations might be discounted or, conversely, large deviations may be felt even more intensely.

2. Interaction of mechanisms: The offer (split_self) is “discounted” by how much it falls short of the fairness reference. The fairness shortfall is computed only when the offer is less than the fair share. In our formulation, the penalty is proportional to the fairness shortfall raised to a power. Thus, the two mechanisms are: (a) a sensitivity to the discrepancy between the fairness reference and the offer, and (b) a non-linear transformation of that discrepancy.

3. Mathematical form: We first define the fairness reference as
  fair_share = (token_self / (token_self + token_opp)) * combined_earning.
Then, the utility for accepting an offer is given by:
  U_accept = split_self – beta · [max(0, fair_share – split_self)]^(gamma).
Here, the max(0, ·) function ensures that the penalty is applied only when the offer is below the fairness threshold. The parameter beta determines the overall sensitivity, and gamma determines the nonlinearity or curvature of the penalty.

4. Parameters and calibration: This model has two learnable parameters. The parameter beta (β) is a non-negative sensitivity term with generous bounds (e.g., from 0 up to 10) that scales the penalty, while gamma (γ) is a positive curvature parameter with bounds (e.g., 0.1 to 5) determining how the fairness shortfall is non-linearly transformed.

5. Mapping to observed behavior: In each trial for a responder, the computed utility is based on the actual monetary gain (split_self) but penalized when the offer falls short of what they would expect in fairness (fair_share). The observed decisions can be modeled as a function of these utilities (with a later softmax or similar temperature parameter for choice probability). Each variable (e.g., token_self, token_opp, combined_earning, split_self) is taken from the dataset and used in computing the fairness reference and the resulting utility.

